package day06;

public class CalcClass implements CalcInterface {

	@Override
	public int Add(int a, int b) {
		// TODO Auto-generated method stub
		return a + b;
	}

	@Override
	public int Sub(int a, int b) {
		// TODO Auto-generated method stub
		return a - b;
	}

	@Override
	public int Mul(int a, int b) {
		// TODO Auto-generated method stub
		return a * b;
	}

	@Override
	public int Div(int a, int b) {
		// TODO Auto-generated method stub
		return a / b;
	}

}
